RecipeInstructions:
c("Prepare pasta according to package directions.", "Wash and drain chicken strips.", "Mix breadcrumbs, flour, and Parmesan cheese together.", "Place milk in dish for dipping.", "Dip chicken in breadcrumb mixture and then in milk and then back in breadcrumbs.", "Place in fry pan in which oil has been heated and fry at medium to medium low temperature until golden.", "Remove and drain chicken.", "In a saucepan on medium heat, melt butter, add olive oil.", "Whisk in flour until mixture is blended.", 
"Quickly add garlic, water, and 1/2 teaspoon of salt stir well.", "Add wine and blend.", "Immediately add half and half and sour cream stir.", "When mixture is smooth add grated cheese stir until melted.", "Finally sprinkle fresh basil in the sauce and stir lightly and remove from heat.", "Garnish: Place 2 cups pasta in individual a pasta dish.", "Spoon about 1/2- 3/4 cup sauce over pasta, add broccoli and mushrooms.", "Place Parmesan Chicken on pasta and sprinkle red crushed pepper and add grated Parmesan cheese if desired."
)
